		//Mueve el mapa
		function hundirtecla(e) {
			this.mensaje.visible = false;
				
			if (e.keyCode == 37 && this.mapa.x < 1200) {
				this.mapa.x += 10;
			} else if (e.keyCode == 39 && this.mapa.x > 0) {
				this.mapa.x -= 10;
			} else if (e.keyCode == 38 && this.mapa.y < 500) {
				this.mapa.y += 10;
			} else if (e.keyCode == 40 && this.mapa.y > 60) {
				this.mapa.y -= 10;
			}
		}
		
